import { FaLinkedin, FaGithub, FaAt } from "react-icons/fa"

export default {
  myFooterData: [
    {
      title: 'Email',
      icon: <FaAt />
    },
    {
      title: 'LinkedIn',
      icon: <FaLinkedin />
    },
    {
      title: 'GitHub',
      icon: <FaGithub />
    },
  ]
}
